import React, { useState } from 'react';

function ToggleButton() {
  const [isStudent, setIsStudent] = useState(true);

  return (
    <div className="flex items-center justify-cente overflow-hidden rounded-lg bg-white w-[30px] h-[10px]">
        <button onClick={() => setIsStudent(true)} className={`px-4 py-2 ${isStudent ? 'bg-blue-500 text-white' : 'bg-gray-200 text-gray-700'}`}/>
        <button onClick={() => setIsStudent(false)} className={`px-4 py-2 ${!isStudent ? 'bg-blue-500 text-white' : 'bg-gray-200 text-gray-700'}`}/>
    </div>
  );
}

export default ToggleButton;
